import {useState} from 'react';
import './style.css'

const Navbar = () => {
    let Links = [
        { name: 'Home', link: '/' },
        { name: 'About', link: '/' },
        { name: 'Contact', link: '/' },
        { name: 'Project', link: '/' },
        { name: 'Project', link: '/' }
    ]
    let [open , setOpen] = useState(false);
    return (
        <div className='w-screen h-[80px] z-10 bg-color-primary fixed '>
            <div className='px-2 flex justify-between items-center w-full h-full'>
                <div className='flex items-center'>
                    <h1>Yohanes.<span>Albert</span></h1>
                    ul
                </div>
            </div>
            <ion-icon name="menu-outline"></ion-icon>
        </div>
    )
}

export default Navbar;
